const fetchData = async (barcode) => {

    const result = await fetch("db/products.json")
    .then(response => response.json())
    .then(data => {
        const product = data.find((product)=> product.barcode === barcode);
        console.log(product);
        return product;
    })
    .catch(err => {
        console.error(Error(err))
        return null;
    });
}

export const getProductByBarcode = (barcode) => {

    return fetchData(barcode);
}
